/*
 Проект базы данных онлайн-кинотеатра.
 Состоит из следующих таблиц:
 	 users - основная информация о пользователях сайта
 	 genre_list - таблица представляющая собой список всех жанров
 	 avatars - таблица хранящая аватары пользователей сайта 
 	 posters - таблица хранящая постеры фильмов
 	 other_picture - прочие изображения на сайте
 	 episode - таблица с информацией о коннкретных сериях фильма\сериала
 	 appraisals - таблица с информацией про оценки пользователей к фильмам
 	 profiles - расширенная информация о пользователях сайта
 	 content - таблица с информацией о фильмах\сериалах на сайте
 	 genre_content - таблица отражающая список жанров для каждого конкретного фильма
 	 comments - таблица с информацией о осталвенных комментариях
 	 browsing_history - история просмотра всех пользователей
 */


drop database if exists Ergney; -- удаляем БД если она имеется

create database Ergney; -- создаем БД

use Ergney; -- выбираем созданную БД

drop table if exists users;

create table users( -- создаем таблицу "юзеры" с базовой информацией о пользователях
id serial primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
nickname varchar(30) not null unique default 'unidentified user', -- уникальный псевдоним пользователя на сайте
email varchar(50) not null unique default 'email is missing', -- емаил пользователя
`password` varchar(50) not null, -- пароль от аккаунта пользователя
created_at datetime default now(), -- когда появилось на сайте
update_at datetime default now() on update now(), -- когда обновлено 

index user_nickname(nickname) -- добовляем индекс для ускоренного поиска по псевдониму пользователя
);


drop table if exists genre_list; 

create table genre_list( -- создаем таблицу со списком всех жанров к которым принадлежит контент на сайте
id  smallint unsigned not null auto_increment unique primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
name varchar(100) not null -- создаем колонку для названий жанров
);


drop table if exists posters;

create table posters( -- создаем таблицу с различными изображениеми используемыми на сайте
id serial primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
created_at datetime default now(), -- когда появилось на сайте
picture blob -- само изображение
);

drop table if exists avatars;

create table avatars( -- создаем таблицу с различными изображениеми используемыми на сайте
id serial primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
created_at datetime default now(), -- когда появилось на сайте
picture blob -- само изображение
);

drop table if exists other_picture;

create table other_picture( -- создаем таблицу с различными изображениеми используемыми на сайте
id serial primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
created_at datetime default now(), -- когда появилось на сайте
picture blob -- само изображение
);

drop table if exists profiles;

create table profiles( -- создаем таблицу "профили" с раширенной информацией о пользователях
id serial primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
user_id bigint unsigned not null unique, -- создаем колонку с идентефикатором связывающим табли
status_account enum('Standart', 'Primium') not null, -- создаем колонку со статусум аккаунта пользователей
avatar_id bigint unsigned not null default 1, -- колонка ссылающаяся на апатар пользователя
phone_number bigint unsigned unique, -- создаем колонку с номерами телефона пользователей
majority bit not null default false, -- инормация о совершеннолетии пользователя
number_card bigint unsigned, -- номер банковской карты пользователя
country varchar(100), -- создаем колонку с информацией о стране где находится пользователи
favorite_genre smallint unsigned not null default 1, -- создаем колонку с информацией о id предпочитаемого жанра пользователя
created_at datetime default now(), -- когда появилось на сайте
update_at datetime default now() on update now(), -- когда обновлено 

index favorite_genre_users(favorite_genre), -- добовляем индексацию по предпочитаемым жанрам пользователей
index country_users(country), -- добовляем индексацию по стране пользователя

foreign key (favorite_genre) references genre_list(id), -- внешний ключ ссылающийся на любимый жанр пользователя
foreign key (user_id) references users(id), -- создаем внешний ключ свзывающие пользоваталей с их профилями
foreign key (avatar_id) references avatars(id) -- внешний ключ связывающий пользователя с его аватором в соответвующей табилце
);


drop table if exists content;

create table content( -- создаем таблицу с информацией о контенте на сайте
id serial primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
name varchar(255) not null default 'unidentified content', -- название фильма\сериала
description text, -- описание
poster_id bigint unsigned not null default 1, -- колонка ссылающаяся на постер 
age_rating enum('G', 'PG', 'PG-13', 'R', 'NC-17') not null default 'G', -- возрастной рейтинг
studio varchar(255) not null default 'unknown', -- информация о студии 
`1st_still_from_the_film` bigint unsigned, -- колонка ссылающаяся на демонстрационный кадр из фильма
`2st_still_from_the_film` bigint unsigned, -- колонка ссылающаяся на демонстрационный кадр из фильма
`3st_still_from_the_film` bigint unsigned, -- колонка ссылающаяся на демонстрационный кадр из фильма
number_of_episodes smallint unsigned not null default 1, -- количество эпизодов
release_year year default (year(now())), -- год выхода
created_at datetime default now(), -- когда появилось на сайте
update_at datetime default now() on update now(), -- когда обновлено 

index name_content(name), -- индексация по названию фильма
index release_year_content(release_year), -- индексация по году выпуска фильма
index studio_content(studio), -- индексация по студии

foreign key (poster_id) references posters(id), -- внешний ключ связывающий фильм с его постером в соответвующей таблице
foreign key (`1st_still_from_the_film`) references other_picture(id), --  внешний ключ связывающий фильм с кадром из фильма в соответсвующей таблице
foreign key (`2st_still_from_the_film`) references other_picture(id), -- внешний ключ связывающий фильм с кадром из фильма в соответсвующей таблице
foreign key (`3st_still_from_the_film`) references other_picture(id) -- внешний ключ связывающий фильм с кадром из фильма в соответсвующей таблице
);


drop table if exists genre_content;

create table genre_content( -- таблица отображающая список жанров для каждого фильма
content_id bigint unsigned not null, -- идентефикатор фильма
genre_id smallint unsigned not null, -- идентефикатор жанра

foreign key (content_id) references content(id), -- внешний ключ связывающий идентефикатор с фильмом в соответсвующей таблице
foreign key (genre_id) references genre_list(id) -- внешний ключ связывающий идегтефикатор с жанром в соответсвующей таблице
);

drop table if exists episodes;

create table episode( -- создаем таблицу с информация о серииях внутри фильмов\сериалов
id serial primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
content_id bigint unsigned not null, -- идентефикатор фильма\сериала
number_episode smallint unsigned not null default 1, -- номер серии
name varchar(255) not null default 'no title', -- название серии
created_at datetime default now(), -- когда появилось на сайте
update_at datetime default now() on update now(), -- когда обновлено 
episode_duration time default (time('01:00:00')), -- длительность серии
release_date date default (date(now())), -- дата выхода

index content_episode(content_id),

foreign key (content_id) references content(id) -- внешний ключ связывающий серии с сериалом
);



drop table if exists browsing_history; 

create table browsing_history( -- создаем таблицу с информацией о просмотренных фильмах пользователями
user_id bigint unsigned not null, -- колонка с пользлваеля
content_id bigint unsigned not null, -- колонка с просмоторенного фильма
episode_id bigint unsigned not null, -- колонка с просмотренной серии
status bit not null default 0, -- колонка со статусом просмотра
created_at datetime default now(), -- когда появилось на сайте
update_at datetime default now() on update now(), -- когда обновлено 

index user_id_history(user_id), -- индексация по пользователям в истории просмотра
index content_id_history(content_id), -- индексация по фильмам в истории просмотра

foreign key (user_id) references users(id), -- внешний ключи связывающий историю просмотра с пользователяем
foreign key (content_id) references content(id), -- внешнию ключи связывающий историю просмотра с фильмом или сериалом
foreign key (episode_id) references episode(id) -- ынешний ключи всязывающий историю просмотра с конекретным эпизодом 
);


drop table if exists comments;

create table comments( -- создаем таблицу комментарии к фильмам
id serial primary key, -- создаем id в качестве пирвичного ключа и уникального идентефикатора
user_id bigint unsigned not null, -- идентефикатор пользователя оставившего комментарий 
content_id bigint unsigned not null, -- идентефикатор фильма к которому оставлен комментарий
body text, -- текст комментария
created_at datetime default now(), -- когда появилось на сайте
update_at datetime default now() on update now(), -- когда обновлено 

foreign key (user_id) references users(id), -- внешний ключ связывающий кооментарий и пользователя
foreign key (content_id) references content(id) -- внешний ключ связывающий кооментарий и фильм
);


drop table if exists appraisal; 

create table appraisals( -- создаем таблицу оценки пользвателей 
user_id bigint unsigned not null, -- идентефикатор пользователя поставившего оценку
content_id bigint unsigned not null, -- идентефикатор филмьа к которому поставили оценку
appraisals tinyint unsigned not null, -- числовое значение оценки
created_at datetime default now(), -- когда появилось на сайте
update_at datetime default now() on update now(), -- когда обновлено 

index content_rating(content_id), -- 

foreign key (user_id) references users(id), -- внешний ключ связывающий оценку с пользвоателем
foreign key (content_id) references content(id) -- внешний ключ связывающий оценку с фильмом
);


alter table content add column rating float unsigned not null default 0; -- добавление колонки с рейтинком в таблицу с информациях о фильмах 
alter table appraisals add check (appraisals > 0 and appraisals < 11); -- добовляем проверку того что в оценках к фильму только числа от 1 до 10

